import React from 'react';

const signin=()=>{
	return(
		<div>
			<div class="card">
		        <h1>Instagram</h1>
		        <input type="text" placeholder="Email"/>
		        <input type="text" placeholder="Password"/>
		        <a class="waves-effect waves-light btn #64b5f6 blue lighten-2">button</a>
	      </div>
		</div>
		)

}

export default signin
